description:
Le site officiel de l'administration française service-public.fr référence une centaine de simulateurs disponibles pour répondre à un large éventail de questions administratives qui se posent aux particuliers et aux professionnels. Certains de ces simulateurs ont été développés par la Direction de l'information légale et administrative (DILA), dont le [simulateur QUELS SONT LES DOCUMENTS NECESSAIRES A MON DOSSIER DE NATURALISATION ?](https://www.service-public.fr/simulateur/calcul/Naturalisation). 
Ce simulateur, conçu par la Dila en 2020, établit la liste des documents pour constituer le dossier de demande de naturalisation selon la situation du demandeur. En fonction de sa situation, des pièces complémentaires peuvent lui être demandées pour l'instruction de son dossier.
A noter : pour obtenir la nationalité française par naturalisation, le demandeur doit remplir certaines conditions.
Les données du simulateur sont mises à jour en fonction des évolutions de la règlementation.
Les simulateurs développés par la DILA utilisent le moteur de simulation G6K dont les sources sont accessibles via le lien : https://github.com/eureka2/G6K. **Merci de noter que ces sources sont incompatibles avec les données du simulateur de cette page. Une mise à jour sera  disponible avant la fin de l'année 2024.** 
Outre les sources, sont à disposition via ce lien :
- La définition (étapes, règles,.), au format XSD, valable pour tous les simulateurs développés avec le moteur G6K ;
- La procédure de mise à disposition et d’installation du moteur.
Les données du simulateur mises à disposition par la DILA sont constituées :
• d’une présentation du simulateur au format PDF ;
• d’un fichier XML présentant les règles de calcul du simulateur ;
• d'une feuille de style au format CSS ;
• des données de référence au format JSON ;
• d’un schéma des données de référence au format SCHEMA.JSON
Vous pouvez nous écrire ou vous abonner à une alerte par mail adressé à : **donnees-dila@dila.gouv.fr**

Lancée en mars 2018, Action Cœur de Ville est une politique prioritaire du gouvernement destiné à soutenir le développement des villes moyennes, de métropoles et d’outre-mer, qui exercent une fonction de centralité pour tout leur territoire. Action Cœur de Ville est fondé sur un investissement massif visant à prioritairement à la revitalisation des centres-villes, avec, aux côtés de l’Etat, trois partenaires nationaux : la Banque des Territoires, Action Logement et l’Agence Nationale de l’Habitat.
Le programme, prolongé jusqu’en 2026, poursuit une triple ambition :
- Accompagner les projets relevant des thématiques initiales : réhabilitation de l'habitat en centre-ville, développement économique et commercial, accessibilité/mobilité, mise en valeur de l'espace public et patrimoine, accès aux équipements et services publics ;
- Faire de la transition écologique le fil conducteur de la période 2023- 2026 et en accompagnant les villes ACV à relever également les défis des transitions démographique et économique auxquelles elles sont confrontées ;
- Elargir le programme en l'étendant au traitement des quartiers de gare et des entrées de ville et d'agglomération pour faire reculer la « France moche » et favoriser un aménagement urbain cohérent.
En complément : 
